sourcesContent:
import styled from "styled-components";

export const Card = styled.div`
  width: 250px;
  height: 500px;
  padding: 10px;
  margin-left: auto;
  margin-right: auto;

  border-radius: 10px;
  box-shadow: 0px -5px 10px white;
`;
